import React, { useEffect, useState } from 'react';
import './ClusterResources.css';

function ClusterResources() {
  const [resources, setResources] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('http://localhost:3000/api/pods') // Updated to full endpoint URL
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        setResources(data);
        setLoading(false);
      })
      .catch(error => {
        setError(error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  return (
    <div className="cluster-resources">
      <ul>
        {resources.map(resource => (
          <li key={resource.name}>
            <p><strong>Pod Name:</strong> {resource.name}</p>
            <p><strong>Namespace:</strong> {resource.namespace}</p>
            <p><strong>Status:</strong> {resource.status}</p>
            <p><strong>Node:</strong> {resource.node}</p>
            <p><strong>Start Time:</strong> {resource.start_time}</p>
            <hr />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ClusterResources;
